import React from 'react';
import SliderItem from './slider.component';

const SliderList = (props) => {
  return (
    <div>
      {props.slider.map((slide) => (
        <SliderItem slide={slide} key={slide.id} />
      ))}
    </div>
  );
};

export default SliderList;
